I'm trying to make a text-based game in Java, and I'm having trouble with the dialogue system. I want to be able to have multiple choices for the player to choose from, and have the game respond accordingly. I've tried using if-else statements, but it's getting really messy and hard to keep track of. Is there a better way to do this?
Here's an example of what I'm trying to do:
System.out.println("You come across a fork in the road. Which way do you go?");
System.out.println("1. Left");
System.out.println("2. Right");
System.out.println("3. Straight");
int choice = scan.nextInt();
if (choice == 1) {
    System.out.println("You go left and find a treasure chest.");
} else if (choice == 2) {
    System.out.println("You go right and find a monster.");
} else if (choice == 3) {
    System.out.println("You go straight and find a dead end.");
    System.out.println("Invalid choice.");
I want to be able to have multiple choices like this, but it's getting really hard to keep track of all the if-else statements. Is there a better way to do this?
You can use a switch statement instead of if-else statements. It's a bit cleaner and easier to read. Here's an example:
System.out.println("You come across a fork in the road. Which way do you go?");
System.out.println("1. Left");
System.out.println("2. Right");
System.out.println("3. Straight");
int choice = scan.nextInt();
switch (choice) {
        System.out.println("You go left and find a treasure chest.");
        System.out.println("You go right and find a monster.");
        System.out.println("You go straight and find a dead end.");
        System.out.println("Invalid choice.");
This way, you can have multiple cases for each choice, and it's easier to see what's going on. You can also use a default case to handle invalid choices.

